    return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
                <p onClick={() => this.handleClick} className='f3 dim link white underline pa3 pointer'>About Me</p>
                <p className='f3 dim link white underline pa3 pointer'>Education</p>
                <p className='f3 dim link white underline pa3 pointer'>Work</p>
        </nav>
    )
}

export default Nav;
